import Vue from "vue";
import Router from "vue-router";
import Login from "./components/Login.vue";
import Register from "./components/Register.vue";
import Home from "./components/Home.vue";
import User from "./components/User.vue";
import Manager from "./components/Manager.vue";
import Profile from "./components/manager/Profile.vue";

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: "/",
      redirect: "/home",
    },
    {
      path: "/login",
      component: Login,
    },
    {
      path: "/register",
      component: Register,
    },
    {
      path: "/home",
      component: Home,
    },
    {
      path: "/user", 
      component: User,
    },
    {
      path: "/index",
      name: "index",
      component: Index,
      // 路由嵌套
      children: [
        {
          path: "/index/profile",
          component: () => import("./components/user/Profile.vue"),
        },
        {
          path: "/index/collection",
          component: () => import("./components/user/collection.vue"),
        },
        {
          path: "/index/share",
          component: () => import("./components/user/Share.vue"),
        },
      ],
    },
  ],
});
